 widely with insight and surprise, including appreciations of artistic athletes such as Muhammad Ali, Johan Cruyff, and the Harlem Globetrotters and such collective creations as Las Vegas and his native New York City. Continuing the traditions of cheeky high-style Dictionarysts, honoring Samuel Johnson and Nicolas Slonimsky (both with individual entries), Kostelanetz offers a \"reference book\" to be enjoyed not only in bits and chunks, but continuously as one of the dozen books someone would take if they planned to be stranded on a desert isle.','http://books.google.com/books/content?id=kDZ7DwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api',_binary 'PNG\r\n\Z\n\0\0\0\rIHDR\0\0\0\\0\0\0\0\0\0\S\0\0\0sRGB\0\\\0\0\0gAMA\0\0a\0\0\0	pHYs\0\0\\0\0\\od\0\0TIDATx^\]Wz\	~7\w_F`\E\ʬ.ɪRI,\%˶V{gƒ\\\Ӵ\\[\\r[V\\Zے`\eJ#Y$H\\\yo\\\<<xB6ι\\\\;X\\uN\\\"\\:]Ut\\:]\:]K\up\\\t	\t.A\q\%\:8\u]\uN\\N\\t\\:]ޱ\Gb^}\/ȊE2k\Ǿ%q?1\S\>\.x+x<aN\\c	h\\\\O\czo\\\\G7AB?|\\\<\I$wL?8㑮2SRw\\;\dɔZnĹN:\a\rw\\՘\\\,<\d\\\}\j\1a\$jܮ\\\Ӄ uږ\1|\UB?-\\(pL鷘H\\\,KZ6\3=\\'\)d-H0\H)ҍ\\0rNUQ\*Q\zOյN?iݸ\Hb؄\\\'o\dc\^\\x/\m=\N*p뚲E\Hq\OĲzr\m\ \y{\\'T\T\\N\X\ѣŘt\%]\\R\'\I\\t)#\\9\\\95k\)H%SKdmӵvKLO)-֩\\% 1%Z#٭+̯0\^\b\zKH8Ao0{\n)1+mFtQ\\5-J[1K+Sb򸴗\z.ib+^\B$\^l\NlR\$(; ﮍ\N^\\w,8HU#l\jTgE\\p\̏8L0O)՘~(t*\\=\\8dH3Is\'\8)g1b\x:gT\2%\{\`Jp\,J9@\2`7)\ZۑJEX#Nj%\t\IYW\߁\\lIUXkK\\G)\g5\]k\P9[\\\<p\jzG`bܸ\Z5iz\\XW\SHػVh\II\ j+\\H\;)$e$e29kub\l\,\/ޥP\-;2f\;\t:eIifF\C>c:-\#&4VK\߱fiYַp֖f\GQo\\\UĬ18-\Ě30\y_K03\@uo\\jI4)HS\U\VSf\\nS\n\z\:8~h)ʊѳG]O\r\i/._!=1.AG\NבcG\\3)\քSb|6gY1Xi\vLm\T۶e,\>\\cV\elb$g#\n\\#)\\,ί\\fM\ru=Iti͹V9\\'_NmŖ+5+K4Z\r[^\ג\'&V[\\\gg3\',AJL4ޥcRe𬈺\F)ʑ\S\]Y]uӔPI^\\'\Pkޱ\@\\01}$\1gW\\L\\p>ٳ|:nŔm\ZM\H6a\#I?KZ)\Rh\f]GӤR9\\rb\bM7[rb\\Y\Ғ\-\a\<d\\Uk\o\}߶\\_/[QF!޲zeII\\m\BAZkub,\\\R-fնU\\\VR\V\*uO\W$KJuA\>yY*	\]k\0y\U4;n2\\\\l{z$-&\X:b\"ȼj