<\',?\$I.\Fݹt7\H3w\`Mמʔ_\\Pn]d}J/<\Qw\\,)\0\0\0\0IENDB`'),(43,'Learning Python','Mark Lutz','O\'Reilly Media, Inc.','2003-12-23',10,'English','Fiction','Portable, powerful, and a breeze to use, Python is the popular open source object-oriented programming language used for both standalone programs and scripting applications. Python is considered easy to learn, but there\'s no quicker way to mastery of the language than learning from an expert teacher. This edition of Learning Python puts you in the hands of two expert teachers, Mark Lutz and David Ascher, whose friendly, well-structured prose has guided many a programmer to proficiency with the language. Learning Python, Second Edition, offers programmers a comprehensive learning tool for Python and object-oriented programming. Thoroughly updated for the numerous language and class presentation changes that have taken place since the release of the first edition in 1999, this guide introduces the basic elements of the latest release of Python 2.3 and covers new features, such as list comprehensions, nested scopes, and iterators/generators. Beyond language features, this edition of Learning Python also includes new context for less-experienced programmers, including fresh overviews of object-oriented programming and dynamic typing, new discussions of program launch and configuration options, new coverage of documentation sources, and more. There are also new use cases throughout to make the application of language features more concrete. The first part of Learning Python gives programmers all the information they\'ll need to understand and construct programs in the Python language, including types, operators, statements, classes, functions, modules and exceptions. The authors then present more advanced material, showing how Python performs common tasks by offering real applications and the libraries available for those applications. Each chapter ends with a series of exercises that will test your Python skills and measure your understanding. Learning Python, Second Edition is a self-paced book that allows readers to focus on the core Python language in depth. As you work through the book, you\'ll gain a deep and complete understanding of the Python language that will help you to understand the larger application-level examples that you\'ll encounter on your own. If you\'re interested in learning Python--and want to do so quickly and efficiently--then Learning Python, Second Edition is your best choice.','http://books.google.com/books/content?id=ftA0yk1Z92wC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api',NULL),(44,'Programming in Python 3','Mark Summerfield','Addison-Wesley Professional','2010',12,'English','Fiction','Now fully updated, this edition brings together all the knowledge needed to write programs, use any library, and even create new library modules. The book teaches every aspect of the Python 3 language and covers all the built-in functionality.','http://books.google.com/books/content?id=H9emM_LGFDEC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api',NULL),(45,'Core Python Programming','Wesley Chun','Prentice Hall Professional','2001',13,'English','Fiction','Experts and novices alike will be able to find information about every command they\'ll need to use Linux. This complete, practical desk reference is organized by function, with a road map-style alphabetical reference for quick access of information about all aspects of running and administering the program. The CD-ROM contains Windows and Linux Python distributions plus extensive cross-platform source code from the book.','http://books.google.com/books/content?id=mh0bU6NXrBgC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api',NULL),(46,'Introduction to Computation and Programming Using Python, second edition','John V. Guttag','MIT Press','2016-08-12',12,'English','Fiction','The new edition of an introductory text that teaches students the art of computational problem solving, covering topics ranging from simple algorithms to information visualization. This book introduces students with little or no prior programming experience to the art of computational problem solving using Python and various Python libraries, including PyLab. It provides students with skills that will enable them to make productive use of computational techniques, including some of the tools and techniques of data science for using computation to model and interpret data.','http://books.google.com/books/content?id=KabKDAAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api',NULL),(47,'Python Cookbook','David Beazley','O\'Reilly Media, Inc.','2013-05-10',11,'English','Fiction','If you need help writing programs in Python 3, or want to update older Python 2 code, this book is just the ticket. Packed with practical recipes written and tested with Python 3.3, this unique cookbook is for experienced Python programmers who want to focus on modern tools and idioms. Inside, you’ll find complete recipes for more than a dozen topics, covering the core Python language as well as tasks common to a wide variety of application domains.','http://books.google.com/books/content?id=S_SJ2LaZH8EC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api',NULL),(48,'Python for Software Design','Allen B. Downey','Cambridge University Press','2009-03-09',10,'English','Fiction','A no-nonsense introduction to software design using the Python programming language. Written for people with no programming experience, this book starts with the most basic concepts and gradually adds new material. Some of the ideas students find most challenging, like recursion and object-oriented programming, are divided into a sequence of smaller steps and introduced over the course of several chapters.','http://books.google.com/books/content?id=M68hAwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api',NULL),(49,'The History of Java','Sir Thomas Stamford Raffles','N/A','1817',12,'English','Fiction','N/A','http://books.google.com/books/content?id=ai-sumyqARkC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api',NULL),(50,'Ecology of Java & Bali','Anthony J. Whitten','Tuttle Publishing','2013-02-05',11,'English','Fiction','The Ecology of Java and Bali is a comprehensive ecological survey of two of the most ecologically diverse islands in the Pacific. It also contains the results of original research, interviews and personal experience. It will be useful to resource managers, ecologists and government planners, as well as to all others interested in the region. Java and Bali are the best known of all the islands in the Indonesian archipelago. Nowhere else in the country are ecological issues of such importance, \nand nowhere else is there a better chance of the major development problems being solved. This is because Java has the greatest concentration of development projects, the densest population, excellent human resources, and the interest of many of the most powerful decision makers. Bali, meanwhile, has the eyes of the world on it as an important tourist destination enjoyed by both domestic and foreign visitors.','http://books.google.com/books/content?id=aP_PAgAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api',NULL),(51,'C, a Reference Manual','Samuel P. Harbison','Prentice Hall','1984',10,'English','Fiction','Description: This fourth edition of the bestselling C reference covers two important developments: the ISO C Amendment 1 (1994), which specifies new facilities for writing portable, international programs in C; and a discussion of how to write C programs that are compatible with C++. Discusses the ongoing, international standardization of C++. Explores the importance of Clean C C code in the common subset of the ISO C and C++ languages. Demonstrates other ways to program in a style that is more compatible with C++. For programmers interested in programming in C++ and the future of C.','http://books.google.com/books/content?id=NYkhAQAAIAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api',NULL),(52,'C++ Programming','D. S. Malik','LESERATI CIRCLE, LLC','2002',7,'English','Fiction','C++ PROGRAMMING: FROM PROBLEM ANALYSIS TO PROGRAM DESIGN, FIFTH EDITION, is the latest edition of the definitive text for CS1 courses. Author D.S. Malik continues to employ his student-focused, example-based methodology to teach C++ programming to introdu','http://books.google.com/books/content?id=COZJlyahZaIC&printsec=frontcover&img=1&zoom=1&source=gbs_api',_binary 'PNG\r\n\Z\n\0\0\0\rIHDR\0\0\0\0\0\0\\0\0\0oh\\Z\0\0\0sRGB\0\\\0\0\0gAMA\0\0a\0\0\0	pHYs\0\0\\0\0\\od\0\0\1IDATx^\ie\v߇;ߛsf\\\\\0\"	8\0(QÖd+de\\7;\xCavlG8hR!d\!)eR$M\0<P\]sUV\y\\\o\{2ofgUW\x\0W{}\a\}Ω\f\$ZQ\'\i6e\#&\!\\z\\\'\o4p\\\t\zi;fϩVk\Ufݐ\,>f\8,g\ZJDӘ\,n\'箍\_~K\m5)Q\=L\7\\\\w\q/&\\N6zcB\\ٌؙ\\>(I1\dge\'j;[\Jh\\И\yQ\9ȷ1\\I4\Z\\f	|҇C\?4\FV\'R&{75˰\mN\^~\SOYa\n-c:Z\x\Y?&/Ҭn9WF}:T02I\$0\\0m4\!\\!f6Lc2щYa4T\'c\I\`<Li[(>f\qEUYϟGfw``z-ZE\\\Z\/C\i^ \\nBYBFݨÀ&\0h\ڋY0u(0Pf\r!ǔأh\uWT4*%S\-GR}:\0@\#},\\0%H\\\1k!kp\"p\\A\=I\]\0<8Ȳm?Z\"S[%x`@!<ڋvGúy皍6\\\\\!s\8b^O\2DL\\fT(\|E~\y\|\\"	2ګ`[\@MD>~\h\\Z\Ng\nc8hԈ\\R`4EZ\\Lh\0\$GNHOG֝e\k-\<\\\\U,\n\#Q\\RtZ\A K?~@H\'\:b5\"\ro\\-&c#T\z\r\nv\Y`i4-4\lFЄN|\\l(-dDR=f\gU1\\\\:S+*\>`<[\&]\r \\\\?5I\rB \O˩M\\^z1v\|zg\\G3VL3\^RS1j>@X\݂\\q>hʀ|(2|2өL\Y\\s\\\3\}Fh\9&\\f>\=>g\K\\\6\\0\@I7\j-\l\0:)f\9\\\\I`M\FԎ?܍sŔO\r\\\'M\\'}>֍IM\"`*\\\L!+l\\np~O@\Aiyz\\0Ԛb&\7	L5\0.\u\l\\"-:>G\V\|\ZoJ\rrs\륈\-~qsm(	Ҽ\k\08L\\uˮ/A6=\MM᤿\+\j\buu9&#Um\\\F\'4\rTf\0q\Zo}=H杵\FSSYi\\#\\$Tt\P۞@,\[<}~\\$\\jѣ\\EυS\fa\\Z\h\0\0c6V\\\`\`\\֛{M%Q^@ڃA\\1\2Ӗ\n8\'\>6~\3ͷ@\pѦ\Tme4Zy	\ں\4MS\\NMj@$\\AV4^ŋW\]\#$UNj>*\`\ttLlqǓ\\\߈K֢Cׯn\znm\\+뱲֊\zR\\|	`\\\w\\n+\w!\~A-2ӿV1\\eޞ\AP9˗7	\'d\\_/\ȱSNae J5:@`\0ĩԠ\n_I3\9\rP$ ?ֱWc+&\\y,Am\H7@~\n\>*p\0㥥\\QIm\U\\S\X\X