 Common Knowledge','Stephen C. Dewhurst','Pearson Education','2005-02-28',10,'English','Fiction','What Every Professional C++ Programmer Needs to Know—Pared to Its Essentials So It Can Be Efficiently and Accurately Absorbed. C++ is a large, complex language, and learning it is never entirely easy. But some concepts and techniques must be thoroughly mastered if programmers are ever to do professional-quality work...','http://books.google.com/books/content?id=Uemuaza3fTEC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api',NULL);
